const DATA_LOCALITY_DESCRIPTION = `
<p class = "description"> <b>Cloud, Private Cloud Or On-Premise</b> <br>

We provide a secure cloud service with data residing locally. If you prefer a more traditional on-premise solution, we can set up a local environment for you as well.</p>

                <a href="#" class="learn_More" id = "learn_Morn_initial">Learn More</a>`;

const SLIDER_ELEMENT = document.querySelector(".slider-images");

const svg_arr = [OPENING, ETL, STATC_TO_INTERACTION_SVG, DATA_LOCALITY];
const descrip_arr = [
  OPENING_DESCRIPTION,
  ETL_DESCRIPTION,
  S_T_I_DESCRIPTION,
  DATA_LOCALITY_DESCRIPTION,
];

let ind = 0;
let interval_id;

function slider() {
  if (ind === svg_arr.length) ind = 0;

  document.querySelectorAll(".slider-buttons button").forEach((button) => {
    button.classList.remove("selected");
  });

  SLIDER_ELEMENT.innerHTML = svg_arr[ind];

  const CAROUSEL_DESCRIPTION_ELEMENT = document.querySelector(
    ".carousel_description"
  );

  CAROUSEL_DESCRIPTION_ELEMENT.innerHTML = descrip_arr[ind];

  const SLIDER_BUTTON = document.querySelector(`[data-image="${ind}"]`);

  SLIDER_BUTTON.classList.add("selected");

  ind++;
}

function startSlider() {
  slider();
  interval_id = setInterval(slider, 8000);
}

setTimeout(startSlider, 500);

const SLIDER_BUTTONS = document.querySelector(".slider-buttons");

SLIDER_BUTTONS.addEventListener("click", (event) => {
  const IS_BUTTON = event.target.tagName.toLowerCase();

  if (IS_BUTTON !== "button") return;

  document.querySelectorAll(".slider-buttons button").forEach((button) => {
    button.classList.remove("selected");
  });

  event.target.classList.add("selected");

  const IMG_IND = event.target.dataset.image;

  SLIDER_ELEMENT.innerHTML = svg_arr[IMG_IND];

  ind = IMG_IND;

  clearInterval(interval_id);
  startSlider();
});
